import { Router } from "express";
import multer from "multer";
import fs from "fs";
import unzipper from "unzipper";
import rimraf from "rimraf"

const imageUploader = multer({ dest: "images/" });
const router = Router();

router.post("/design", imageUploader.single("design"), (req, res) => {
  const processedFile = req.file || {}; // MULTER x l v gn i tng FILE vo req
  let orgName = processedFile.originalname || ""; // Tn gc trong my tnh ca ngi upload 
  orgName = orgName.trim().replace(/ /g, "-");
  const fullPathInServ = processedFile.path; // ng dn y  ca file va c upload ln server
  // i tn ca file va upload ln, v multer ang t default ko c ui file
  const newFullPath = `${fullPathInServ}-${orgName}`;
  fs.renameSync(fullPathInServ, newFullPath);
  if (orgName.includes("zip") && !!req.body.extractpath) {
    rimraf.sync(req.body.extractpath);
    fs.createReadStream(newFullPath).pipe(
      unzipper.Extract({ path: req.body.extractpath })
    ); 
  } 
  res.send({
    status: true,
    message: "file uploaded",
    fileNameInServer: newFullPath,
  });
});

export default router;

